DROP TABLE IF EXISTS `tp_withdraw`;
CREATE TABLE `tp_withdraw` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `user_id` int(11) NOT NULL COMMENT '用户ID',
  `num` decimal(10,2) NOT NULL COMMENT '提现金额',
  `bank` varchar(10) DEFAULT NULL COMMENT '银行名称',
  `bankname` varchar(50) DEFAULT NULL COMMENT '开户银行',
  `name` varchar(30) DEFAULT NULL COMMENT '开户名',
  `account` varchar(50) DEFAULT NULL COMMENT '账号',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '提现状态',
  `remark` varchar(50) DEFAULT NULL COMMENT '备注',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '提现时间',
  `updated_at` timestamp NULL DEFAULT NULL COMMENT '审批时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

SET FOREIGN_KEY_CHECKS = 1;
