INSERT INTO `tp_comment` VALUES (129, 27, '人生若只如初见，何事秋风悲画扇。等闲变却故人心，却道故人心易变。\r\n骊山语罢清宵半，泪雨零铃终不怨。\r\n何如薄幸锦衣郎，比翼连枝当日愿。\r\n与意中人相处应当总像刚刚相识的时候，\r\n是那样地甜蜜，那样地温馨，\r\n快乐的。即使偶有一些不如意的地方，\r\n来趋走炎热，到了秋天就没人理睬了，\r\n古典诗词多用扇子的来比喻被冷落的\r\n女性。这里是说本应当相亲相爱，但\r\n却成了相离相弃。又将词情从美好的回忆一下子拽到了残酷的现实当中。', 1, 3, '2019-11-22 11:16:59', 0, 0);
