INSERT INTO `tp_text_image` VALUES (3, 26, 0, '我好开心啊', '人生若只如初见，何事秋风悲画扇。等闲变却故人心，却道故人心易变。骊山语罢清宵半，泪雨零铃终不怨。何如薄幸锦衣郎，比翼连枝当日愿。与意中人相处应当总像刚刚相识的时候，是那样地甜蜜，那样地温馨', NULL, '2019-11-19 16:28:20', NULL, 1);
INSERT INTO `tp_text_image` VALUES (7, 25, 1, '我好开心啊', '人生若只如初见，何事秋风悲画扇。等闲变却故人心，却道故人心易变。骊山语罢清宵半，泪雨零铃终不怨。何如薄幸锦衣郎，比翼连枝当日愿。与意中人相处应当总像刚刚相识的时候，是那样地甜蜜，那样地温馨', 'http://img.kaiyanapp.com/ab7f21651dd6a43cc5363615a6f69e62.jpeg?imageMogr2/quality/60/format/jpg,http://img.kaiyanapp.com/ab7f21651dd6a43cc5363615a6f69e62.jpeg?imageMogr2/quality/60/format/jpg', '2019-11-19 16:38:32', NULL, 1);
INSERT INTO `tp_text_image` VALUES (9, 24, 1, '我好开心啊', '人生若只如初见，何事秋风悲画扇。等闲变却故人心，却道故人心易变。骊山语罢清宵半，泪雨零铃终不怨。何如薄幸锦衣郎，比翼连枝当日愿。与意中人相处应当总像刚刚相识的时候，是那样地甜蜜，那样地温馨', 'http://img.kaiyanapp.com/500d5c01e9deff5aacb5e1de9771752f.png?imageMogr2/quality/60/format/jpg,uploads/img/5dafc34c5705d.jpg,uploads/img/5dafc35aadcea.jpg,uploads/img/5dafc49d5bca8.jpg,http://s1.dwstatic.com/group1/M00/AD/6D/5be184db699943948dab11b5b7ae3621.gif,http://s1.dwstatic.com/group1/M00/94/9F/89ce291909a14e418968388abd72688e.gif', '2019-11-20 12:31:38', NULL, 1);
