INSERT INTO `tp_text_image` VALUES (27, 27, 1, '今天的炸酱面好好吃啊', '今天的炸酱面好好吃啊', 'uploads/img/5dde27c6686d6.jpg', '2019-11-27 15:37:58', NULL, 1);
INSERT INTO `tp_text_image` VALUES (32, 27, 0, '我认识一个同事，今年三月刚拿到第一份实习工资，2500元。 当天晚上，他就去网上分期买了台苹果pro', '我认识一个同事，今年三月刚拿到第一份实习工资，2500元。 当天晚上，他就去网上分期买了台苹果pro，17999元，12期，每月1600元多。 他盘算：每月1600元，还剩900，吃住在学校，基本没啥开销，毕业后转正，工资至少5000，除去还款，吃住都可以搞定，分期的费用完全可以承担。 他给自己挖坑，盲目自信开始，毕业后，他和朋友一起找房，预算每人500一个月，合租，这个价格只适合城中村，两人都看不上，楼层低、面积窄，没阳光、没信号。 最后他们找到了一套小区里的房子，两房一厅，3200一个月，押二付一，他咬牙从借呗里借了5000出来，全部交给了房东。 网易严选的厨具、宜家的办公桌和沙发、搬家费、宽带费，他狠了狠心，又把第一张信用卡刷爆了，额度不高，5000块。 美好的毕业生活从还债开始，每个月的状态就是：工资还没发，银行账单就到了 最穷时，他连2块钱公交车费都快拿不出来，晚上回来清水煮面条，没有油只有盐和生抽，最狠的时候，一瓶老干妈吃了半个月。 毕业不到半年，他已经欠了5万块，还不算利息，我已经猜到，接下来三年，他会越欠越多，开更多的卡，借更多的网贷、高利贷，拆东墙补西墙。 典型的贫民窟青年，表面上风光无限，背地里狂风呼啸 一边消费着根本不符合身份的日用品，一边承受着这个收入根本承受不起的债务，一步步把自己的人生推向债务深渊，万劫不复。 你说他蠢吗？大学毕业，智商应该不低。 你说他不蠢吗？人生还没开始，就让自己背了一身的网贷，还自诩有为青年。 这样的财商，老实说，是真蠢，该骂吗？该！我觉得该狠狠地骂，不然永远不会清醒。', NULL, '2019-11-27 15:54:26', NULL, 1);
INSERT INTO `tp_text_image` VALUES (33, 27, 0, '老婆出轨，车上有定位录音，我骗她说出去出差，怎么才能报复，而不离婚，关键舍不得俩孩子。', '老婆出轨，车上有定位录音，我骗她说出去出差，怎么才能报复，而不离婚，关键舍不得俩孩子。', NULL, '2019-11-27 16:03:28', NULL, 1);
INSERT INTO `tp_text_image` VALUES (34, 27, 0, '【张秀才的艳遇】\n从前，有一个张秀才，长得细皮嫩肉，一表人才，都说他这辈子吃不了庄户饭，将来一定能升', '【张秀才的艳遇】\n从前，有一个张秀才，长得细皮嫩肉，一表人才，都说他这辈子吃不了庄户饭，将来一定能升官发财。他也刻苦攻读，一心想高榜得中，混一个一官半职的好光宗耀祖。可是，这个好事可却就是临不到他的头上。他是一连考了三次，每次都是名落孙山。后来他看看自己家境贫寒，家里也没有闲钱再供自己读书，想想可能也没有升官发财的命。就放弃了读书，跟着几个朋友学着做点小生意挣点钱来养家糊口。\n    有一次，他和他们经常一起做生意的几个朋友，又从当地收了一些土特产，合伙租了一条船去杭州去贩卖。他们到了以后，没有想到这一次他们运气不济，货不好卖。等了半个多月以后才开始逐渐的有卖货的，卖完货的一算挣钱也不多，就陆陆续续的回家了。等到张秀才卖完货的时候，他们一起来的几个朋友都已经回去了。张秀才卖完货算了一下账，万幸还没有赔钱，挣的钱也只能够来回的费用，他便收拾了一下就踏上了回家的路。\n    一天傍黑天的时候他来到了一个县城，一路走来是又累又饿。心里就一个念头，赶快找一个客栈填饱肚子好好地睡上一觉。可是，他一连找了几家客栈都是客满，真是越渴了越给盐吃。他也只好拖着他疲惫的身体继续找下去，不管怎么说也不能住在大街上吧。这时候他就发现前面的十字大街旁有一家客栈，他紧走了几步来到门口一看，还是挂出了客满的招牌。气的他一屁股坐在了客栈门口不走了。恰巧这时候客栈掌柜的正好看见了他，赶忙出来客气的对他说：“真的对不住了，店里已经客满，你再到别处去看看吧。”\n    张秀才坐在门口里也不起来，恳求店掌柜的说：“掌柜的，你就行行好吧，我实在是走不动了，就是住柴房也行啊。”\n    掌柜的看了看他，见他已是筋疲力尽，看来城里的客栈真的都已经住满了。他就为难的对他说：“我这里倒是还有一间客房，前几年也住过几回人。可是，到了晚上客人就吓得跑出房间来，说房间里闹鬼，要求换房。从那以后这间客房就闲了下来，再也没有往里面安排过客人。如果你有胆量，你就住进去，我半价收你的房钱。”\n    张秀才一听来了希望，他本就是读书人出身从来不信邪魔鬼祟，就对掌柜的说：“你放心吧，我敢住。”\n    这时候掌柜的又说：“那好吧，你现在先吃点东西，我就让小二去给你收拾房间。”\n    张秀才这回放心了，他赶忙点几样好菜，要了一壶好酒，然后狼吞虎咽的吃了起来。等到他酒足饭饱以后店小二已经拾掇好了房间，过来把他领到了楼上。张秀才到了房', NULL, '2019-11-27 16:04:20', NULL, 1);
